import React from "react";
import Nav from "./Nav";

function Insert() {

  return (
    <div>
      <Nav />
      <div>
        <h1 class="dashbord">Insert</h1>
      </div>
      <div >
                < input placeholder = "" name = "criminal_category_id" value = {post.criminal_category_id} onChange = { handleInputs } type = "text" / >
              </div>

              < button type = "button" onClick={button} class = "btn btn-outline-success" > submit < /button>

    </div>
  );
}

export default Insert;
